import Admin from "./pages/Admin";
import Basket from "./pages/Basket";
import DevicePage from "./pages/DevicePage";
import Shop from "./pages/Shop";
import Auth from "./pages/Auth";
import EditDevice from "./pages/EditDevice"; // üëà –Ω–æ–≤—ã–π –∏–º–ø–æ—Ä—Ç

import {
  ADMIN_ROUTE,
  BASKET_ROUTE,
  DEVICE_ROUTE,
  LOGIN_ROUTE,
  REGISTRATION_ROUTE,
  SHOP_ROUTE
} from "./utils/consts";

export const authRoutes = [
    {
        path: '/admin',
        Component: Admin
    },
    {
        path: '/basket',
        Component: Basket
    }
];

export const publicRoutes = [
    {
        path: '/',
        Component: Shop
    },
    {
        path: '/login',
        Component: Auth
    },
    {
        path: '/registration',
        Component: Auth
    },
    {
        path: '/device/:id',
        Component: DevicePage
    }
];
